        String kType = getTypeI(type);
        int kSize = 0;
        if (kType.equals(DSA_TYPE)) {
            kSize = DSA_KEY_SIZE;
        } else if (kType.equals(RSA_TYPE)) {
            kSize = RSA_KEY_SIZE;
        } else {
            throw new CryptoUtilsException("Invalid algorithm : " + kType);
        }
